### Instruction:
In javascript output the values in a dictionary sorted by key alphabetically.

### Response:

```javascript
var myDictionary = {name:"John", age:30, occupation:"Engineer"};
var myDictionary2 = {age:45, name:"Mary", gender:"Female"};

// Sort the dictionary by key alphabetically
myDictionary.sort(function (a, b) { return a[Object.keys(a)[0]].localeCompare(b[Object.keys(b)[0]]); });
console.log("Sorted Dictionary 1:", myDictionary);

// Sort the dictionary by key alphabetically
myDictionary2.sort(function (a, b) { return a[Object.keys(a)[0]].localeCompare(b[Object.keys(b)[0]]); });
console.log("Sorted Dictionary 2:", myDictionary2);
```
